import './features.css'

const Features = () => {
  return (
    <div className='chatgpt3__features section__padding' id="features">
        <div className='gpt3__feautres-heading'>
          <h1 className='gradient__text'></h1>
          </div>    
    </div>
  )
}

export default Features
